            </div>
            <div className='card-body'>
                <div className="row">
                    <div className="col-sm-12 col-md-12 col-lg-12">
                        <div className='row espaciadoVertical'>
                            <div className="col-sm-12 col-md-12 col-lg-12">
                                adassda
                            </div>
                        </div>
                        <div className='row espaciadoVertical'>
                            <div className='col-sm-4 col-md-4 col-lg-4 text-left'><span className="textos"><span className="fa fa-id-card-o"></span>&nbsp;Fecha:</span></div>
                            <div className="col-sm-6 col-md-6 col-lg-6">
                                01-01-1900
                            </div>
                            <div className='col-sm-2 col-md-2 col-lg-2'></div>
                        </div>
                        <div className='row espaciadoVertical'>
                            <div className='col-sm-5 col-md-5 col-lg-5 text-left'><span className="textos"><span className="fa fa-id-card-o"></span>&nbsp;Prox. Mantenci贸n:</span></div>
                            <div className="col-sm-5 col-md-5 col-lg-5">
                                01-01-1900
                            </div>
                            <div className='col-sm-2 col-md-2 col-lg-2'></div>
                        </div>
                        <div className='row espaciadoVertical'>
                            <div className='col-sm-2 col-md-2 col-lg-2 text-left'><span className="textos"><span className="fa fa-envelope"></span></span></div>
